const rankedtreemakeset = _makeset( RankedTreeNode ) ;
export default rankedtreemakeset ;

export default function rankedtreeunion ( a , b ) {

	if ( a.rank < b.rank ) {
		a.parent = b ;
		return b ;
	}

	else if ( a.rank > b.rank ) {
		b.parent = a ;
		return a ;
	}

	else {
		b.parent = a ;
		++a.rank ;
		return a ;
	}

}

export default function _prototype ( Set , union , find ) {

	Set.prototype.union = function ( other ) {
		return union( this , other ) ;
	} ;

	Set.prototype.find = function ( ) {
		return find( this ) ;
	} ;

}
